import java.util.*;public class StackDemo {    public static void main(String[] args) {        Stack<Integer> s = new Stack<Integer>();        s.push(3);        s.push(4);        s.push(5);        int n = s.peek();        int top = s.pop();        top = s.pop();        top = s.pop();        System.out.println(n);        System.out.println(top);        System.out.println(s.empty());        System.out.println(s.search(3));    }}